import {withAmp} from 'next/amp'
import React from 'react'
import Head from 'next/head'

const experiment = (props) => (
        <div>
                <Head>
                <script async custom-element="amp-video" src="https://cdn.ampproject.org/v0/amp-video-0.1.js"></script>
                    <style amp-custom>{`

                    @media screen and (min-width: 320px){

                        .video_boy{
                            display:flex;
                            margin:0;
                        }


                    }

                    `}</style>
                </Head>
                <body>
                <amp-iframe width="805" height="453" src="https://www.youtube.com/embed/mbLu3B85syM" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></amp-iframe>
                    <amp-video class="video_boy" autoplay loop noaudio width="320"  height="568" layout="responsive"><source src="https://www.tesla.com/ns_videos/hp_2019/power-hero-mobile.mp4" type="video/mp4"/></amp-video>
                </body>    
        </div>
)

export default withAmp(experiment, {hybrid:true})
